import { useEffect, useState } from "react";
import { getUser } from "../../api";

function Profile() {
    const [data, setData] = useState([])
    
    
    useEffect(() => {
        getUser()
            .then(response => {
                setData(data)
                console.log(response.data)
            })
            .catch(err => {
                console.log(err)
            })        
    }, [])
    
    console.log('data = ',data)
    
    return (  
        <div>
            Name profile
        </div>
    );
}

export default Profile;
